const App = () => {
  const [isOverlayVisible, setIsOverlayVisible] = useState(false);

  const handleOpenOverlay = () => {
    setIsOverlayVisible(true);
  };

  const handleCloseOverlay = () => {
    setIsOverlayVisible(false);
  };

  const handleConfirmOverlay = (text) => {
    // Handle the confirmed text here
    console.log('Confirmed Text:', text);
  };

  return (
    <div>
      <button onClick={handleOpenOverlay}>Open Overlay</button>

      {isOverlayVisible && (
        <Overlay onClose={handleCloseOverlay} onConfirm={handleConfirmOverlay} />
      )}
    </div>
  );
};

export default App;
